// Header.js
import React from 'react';
import { View, Text } from 'react-native';

const Header = () => {
  return (
    <View style={styles.header}>
      <Text>This is the Header</Text>
    </View>
  );
};
const styles = StyleSheet.create({
  header: {  
    backgroundColor: '#DCDCDC',    
  }
});
export default Header;
